script: |
  super -f text -I q925.spq | sort > q925.out

inputs:
  - name: q925.spq
    data: |
      SELECT DISTINCT - 78 + - col2 FROM tab1 (FORMAT parquet) WHERE + - col2 + - col1 + - col0 * col2 NOT BETWEEN - + col1 AND NULL;
  - name: tab1

outputs:
  - name: q925.out
    data: |
      -137
      -146
      -174
